Blue Man Group in CityWalk at Universal Orlando Resort will not be returning to operations after the pandemic. The theatre show opened in 2007 and hosted over 6,000 shows. 

Did you get a chance to see this spectacular show?

@UniversalORL #bluemangroup

More than 60 million people live with cardiovascular disease in the EU. Tomorrow I will participate in a meeting organised by the MEP Heart Group, to draw lessons from the challenges posed by the COVID-19 pandemic to patients suffering from CVD. 

#CVD #COVID19 

